INSERT INTO public.faq_faq (id, question, response, locked, category_id, responder_id, visitor_id) VALUES (2, 'consectetuer adipiscing elit', '["Bien que cette locution n''ait pas de sens, elle a une longue histoire. Elle a été utilisée pendant plusieurs siècles par les typographes pour mettre en évidence les apparences les plus caractéristiques de leurs polices. Elle est utilisée car les lettres qu''elle contient et l''espacement des caractères font apparaître de façon optimale l''épaisseur, la présentation et toutes les autres caractéristiques importantes de la police.", "Une publication de 1994 du magazine « Before & After » décrit l''expression « Lorem ipsum ... » comme une version latine peu fidèle d''un passage d''un traité de théorie éthique, de Finibus Bonorum et Malorum, écrit par Cicéron en 45 avant Jésus-Christ. Le passage « Lorem ipsum ... » est tiré du texte « Neque porro quisquam est qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit ... » qui peut se traduire par « Personne n''aime la douleur en elle-même, ne la recherche et ne la souhaite, tout simplement parce qu''il s''agit de la douleur... ».", "Au 16e siècle, un imprimeur a adapté le texte de Cicéron afin d''en tirer une page d''exemples typographiques. Depuis, le texte est devenu le standard utilisé par l''industrie de l''imprimerie pour les textes factices. Avant l''avènement de la PAO, les graphistes devaient faire des maquettes de présentation en dessinant des lignes factices pour figurer le format du texte. L''avènement des feuilles auto-adhésives préimprimées avec le texte « Lorem ipsum » a permis de figurer de façon plus réaliste où un texte devrait s''insérer dans une page."]', true, 2, 1, 1);
